window.bookSummaryJSON = "<p>There will be math.&nbsp;</p> <p>Quinn Lyons has slid beneath the radar. She cleans floors in a mining station next to a section of the Asteroid Belt called the Briar Patch. The humble act doesn’t last. When the station recovers a ghost ship. It leads her and Angle Xiang on the quest to answer a riddle about what it takes for small ships to travel as fast as large ones in space. The process unmasks them and ties them closer together.</p>"; 
